import React from 'react'
import {startCommitSaga} from "../../redux";
import { Route } from 'react-router'
import ListCommits from "../../pages/listCommits/listCommits.connected";

class ListCommitsRoute extends React.Component {
    componentDidMount() {
        startCommitSaga()
    }
    render(){
       return (
           <React.Fragment>
                <Route exact path='/:user/:repo/commits' component={ListCommits} />
           </React.Fragment>
       )
    }
}

export default ListCommitsRoute
